column2:
Полномочия по подготовке (формированию) и направлению в хозяйственные общества, имеющие стратегическое значение для оборонно-промышленного комплекса и безопасности Российской Федерации, а также общества, находящиеся под их прямым или косвенным контролем, письменных запросов или запросов 
в электронной форме, 
получение, обработка и анализ ответов на такие запросы.

Расходы № 1 – Модернизация единой информационной системы Росфинмониторинга 
с целью направления запросов: - формирование запросов;
- шифрование запросов, подписание запросов усиленной квалифицированной электронной подписью и оправление запросов путем их размещения через сервис «Личный кабинет», информирование обществ о направлении запроса;
- регистрация факта получения запроса обществом;
Расходы № 2 – Модернизация единой информационной системы Росфинмониторинга 
с целью получения ответов обществ:
- формирование ответов обществ и их направление с использованием сервиса «Личный кабинет»;
- получение и регистрация Росфинмониторингом ответов обществ с использованием усиленной квалифицированной электронной подписи и средств криптографической защиты информации;
- уведомление обществ о получении и возможности обработки поступившего ответа или невозможности обработки;  
Расходы № 3 – модернизация единой информационной системы Росфинмониторинга с целью учета, хранения и обработки сведений, поступающих от обществ на запросы Росфинмониторинга

Возможность применения единообразного подхода в формализации документирования процедур проведения налогового мониторинга:
 - уведомление налогоплательщика о досрочном прекращении налогового мониторинга; 
- уведомление налогоплательщика о наличии (об отсутствии) невыполненных мотивированных мнений;
- уведомление налогоплательщика об изменении (оставлении без изменения) мотивированного мнения налогового органа.

разработка и утверждение порядка ведения реестра отраслевых сметных нормативов, применяемых при проведении работ по ремонту и содержанию автомобильных дорог федерального значения и дорожных сооружений, являющихся технологической частью этих дорог;
- ведение реестра отраслевых сметных нормативов, применяемых при проведении работ по ремонту и содержанию автомобильных дорог федерального значения и дорожных сооружений, являющихся технологической частью этих дорог;
 - разработка отраслевых сметных нормативов, предназначенных для определения сметной стоимости строительства объектов капитального строительства, учитывающих специфику дорожной отрасли;
- утверждение требований по конструированию и расчету дорожных одежд автомобильных дорог, необходимые при проектировании автомобильных дорог;
- утверждение типовых проектных решений (конструкции земляного полотна, конструкции дорожных одежд, конструкции водопропускных труб, укрепление откосов земляного полотна, конструкции водоотводных лотков и др.), рекомендуемых к применению при проектировании и строительстве автомобильных дорог; 
- разработка и утверждение порядка формирования и использования банка данных проектной документации и технических (технологических) решений повторного применения; 
- ведение банка данных проектной документации и технических (технологических) решений повторного применения;
- разработка и утверждение порядка разработки и согласования индивидуальных технических условий, используемых при проектировании и строительстве автомобильных дорог;
- разработка и утверждение документов в области стандартизации, а также рекомендательных документов, содержащих характеристики продукции и технологий, в том числе инновационных, и (или) правила и принципы в отношении процессов проектирования (включая изыскания), производства, строительства, монтажа, наладки, эксплуатации, хранения, перевозки, реализации и утилизации

Формирование дифференцированной процедуры допуска заявок для участия в закупках лекарственных препаратов, включенных в перечень жизненно необходимых и важнейших лекарственных препаратов (в зависимости от наличия поданных заявок на поставку соответствующих лекарственных препаратов):
1) закупка лекарственных препаратов с полным циклом производства на территории Российской Федерации (совокупность всех стадий технологического процесса - производство субстанций, производство готовой лекарственной формы, первичная упаковка, вторичная упаковка и выпускающий контроль качества), их приоритет перед лекарственными препаратами, в отношении которых на территории Российской Федерации осуществляются технологические операции, соответствующие совокупности стадий производства готовой лекарственной формы, упаковки и выпускающего контроля качества, а также лекарственными препаратами, происходящими из иностранных государств, включая те, страной происхождения которых является государства-члены Евразийского экономического союза ;
2) закупка лекарственных препаратов, странами происхождения которых являются Российская Федерация и государства-члены Евразийского экономического союза (все стадии производства производятся на их территориях, за исключением стадии производства фармацевтических субстанций), их приоритет перед лекарственными препаратами, происходящими из иностранных государств;
3) лекарственные препараты, происходящие из иностранных государств.

1)	Полномочия ФНС России по контролю уплаты самозанятыми мигрантами из ЕАЭС, а также трудовыми мигрантами из ЕАЭС, работающими у юридических лиц и в отношении которых работодатели не подали уведомление в МВД России, НДФЛ и страховых взносов по итогам каждого месяца работы в РФ;
2)	ПолномочияФНС Россиипо контролю раз в квартал уплаты работодателями, нанимающими трудовых мигрантов из ЕАЭС, НДФЛ и страховых взносов за таких мигрантов;
3)	Обязанность ФНС Россиипо уведомлению трудовых мигрантов из ЕАЭС, работающих у юридических лиц, в отношении которых работодатели не уплатили НДФЛ и страховые взносы в полном объеме, о необходимости самостоятельно уплатить НДФЛ и страховые взносы в течение 30 дней с даты получения уведомления;
4)	Обязанность ФНС Россиипо принятию заявлений на налоговый патент от самозанятых мигрантов из ЕАЭСи выдаче таким мигрантам налогового патента;
5)	Обязанность ФНС Россиипо направлению уведомления работодателю о подтверждении правана уменьшение исчисленной суммы налогов и страховых взносов на самостоятельно уплаченные трудовыми мигрантами из ЕАЭС НДФЛ и страховые взносы.

- разработка и реализация технологических решений по формированию запросов в ЕИС Росфинмониторинга, направлению запросов, формированию подтверждений получения запросов;
- разработка и реализация технологических решений по формированию сервисов приема и обработки ответов на запросы, квитанций о подтверждении приема ответов на запросы, а также уведомлений об отказе в приеме ответов;
- интеграция сведений, поступающих в  рамках ответов юридических лиц на запросы, в существующие компоненты ЕИС Росфинмониторинга;
-обработка технологических документов

