Проведение категорирования комплексов технологически и технически связанных между собой зданий, строений, сооружений и систем, отдельных зданий, строений и сооружений, находящихся в туристско-рекреационных особых экономических зонах Северо-Кавказского федерального округа, то есть отнесения их к определенной категории с учетом степени угрозы совершения на них террористического акта и возможных последствий его совершения на основании оценки состояния защищенности, учитывающей значимость для инфраструктуры и жизнеобеспечения и степень потенциальной опасности совершения террористического акта; установления комплекса мер, соответствующих степени угрозы совершения террористического акта и его возможным последствиям, в зависимости от присвоенной категории;
контроль за выполнением требований, включая должностных лиц, уполномоченных на проведение проверок, а также виды проверок, основания, периодичность и сроки их проведения;
составление и актуализация паспорта безопасности

