- проведение обследования и изучения реализуемых на транспортном средстве мер от угроз совершения актов незаконного вмешательства;
- разработка, утверждения паспорта обеспечения транспортной безопасности транспортного средства субъектами транспортной инфраструктуры;
- утверждение типовой формы паспорта обеспечения транспортной безопасности транспортного средства.

- процедура проведения досмотра, дополнительного досмотра и повторного досмотра в целях обеспечения транспортной безопасности;
- обеспечения на объекте транспортной инфраструктуры доступа к данным               с технических средств обеспечения транспортной безопасности подразделениям федерального органа исполнительной власти в области обеспечения безопасности Российской Федерации, федерального органа исполнительной власти, осуществляющего функции по выработке государственной политики и нормативно-правовому регулированию в сфере внутренних дел, Федеральной службы по надзору в сфере транспорта, а также передачи таких данных в служебные помещения на объекте транспортной инфраструктуры, предоставленные (переданные) территориальным органам и (или) подразделениям указанных федеральных органов исполнительной власти для выполнения задач                                на объекте транспортной инфраструктуры в соответствии с установленными полномочиями;
- установление зоны транспортной безопасности.

- процедура проведения досмотра, дополнительного досмотра и повторного досмотра в целях обеспечения транспортной безопасности;
обеспечения на объекте транспортной инфраструктуры - доступ к данным                с технических средств обеспечения транспортной безопасности подразделениям федерального органа исполнительной власти в области обеспечения безопасности Российской Федерации, федерального органа исполнительной власти, осуществляющего функции по выработке государственной политики и нормативно-правовому регулированию в сфере внутренних дел, Федеральной службы                     по надзору в сфере транспорта, а также передачи таких данных в служебные помещения на объекте транспортной инфраструктуры, предоставленные (переданные) территориальным органам и (или) подразделениям указанных федеральных органов исполнительной власти для выполнения задач на объекте транспортной инфраструктуры в соответствии с установленными полномочиями;
установления зоны транспортной безопасности.

- проведение обследование объекта транспортной инфраструктуры;
разработка и утверждение паспорта обеспечения транспортной безопасности объекта транспортной инфраструктуры;
- особенности привлечения подраздления транспортной безопасности в случае если на объекте транспортной инфраструктуры осуществляется посадка (высадка) пассажиров, перевозка которых осуществляется перевозчиками иностранных государств, выполняющих автомобильные перевозки из пункта отправления в пункт назначения, расположенные                       на территории Российской Федерации, перевозки в Российскую Федерацию,              из Российской Федерации, через Российскую Федерации.

-распространение действия Правил аттестации и Правил аккредитации на персонал специализированных организаций;
- наделение аттестующую организацию большей компетенцией в целях сокращения времени проведения аттестации                  при обращении заявителя в компетентный орган, являющийся органом аттестации;
-исключение необходимости предоставление аттестуемым лицом, имеющим действующее свидетельство
об аттестации, в случае аттестации в отношении иных видов транспорта и (или) иной категории сил обеспечения транспортной безопасности, документов, подтверждающих отсутствие ограничений, предусмотренных статьей 10 Федерального закона № 16-ФЗ, установив при этом срок действия документов
не более 30 дней с даты ранее выдачи действующего свидетельства об аттестации;
- предоставление права подразделениям ведомственной охраны федеральных органов исполнительной власти в области транспорта, которые являются аттестующими организациями осуществлять обработку персональных данных в отношении аттестуемых лиц данных подразделений.

Выдача заключений, а именно:
заключение о том, что в границах географического объекта, находящегося на территории Российской Федерации, заявитель производит товар, особые свойства которого исключительно определяются характерными для данного географического объекта природными условиями и (или) людскими факторами, которое прикладывается к заявке на государственную регистрацию наименования места происхождения товара и на предоставление исключительного права на такое наименование;
заключение о том, что в границах находящегося на территории Российской Федерации географического объекта (виноградо-винодельческой зоны, виноградо-винодельческого района, виноградо-винодельческого терруара), наименование которого заявляется в качестве наименования места происхождения товара, заявитель производит российское вино, особые свойства которого исключительно или главным образом определяются характерными для данного географического объекта природными условиями и (или) людскими факторами;
заключение, прилагаемое к заявке на предоставление исключительного права на ранее зарегистрированное наименование места происхождения товара, содержащего сведения о том, что в границах находящегося на территории Российской Федерации географического объекта, наименование которого заявляется в качестве наименования места происхождения товара, заявитель производит алкогольную продукцию, обладающую особыми свойствами, содержащимися в Государственном реестре географических указаний и наименований мест происхождения товаров Российской Федерации;
заключение, прилагаемое к заявке на предоставление исключительного права на ранее зарегистрированное наименование места происхождения товара, содержащего сведения о том, в границах находящегося на территории Российской Федерации географического объекта (виноградо-винодельческой зоны, виноградо-винодельческого района, виноградо-винодельческого терруара), заявитель производит российское вино, обладающее особыми свойствами, содержащимися в Государственном реестре ;
заключение, подтверждающее обоснованность и необходимость внесения изменений в сведения, относящиеся к государственной регистрации наименований места происхождения товара, которое прикладывается к заявлению о внесении изменений в Государственный реестр;
заключение о том, что заявитель производит в границах географического объекта товар, обладающий особыми свойствами, указанными в Государственном реестре, которое может быть приложено к заявлению о продлении срока действия исключительного права на наименование места происхождения товара;
заключение о том, что заявитель в границах географического объекта (виноградо-винодельческой зоны, виноградо-винодельческого района, виноградо-винодельческого терруара) производит российское вино, особые свойства которого исключительно или главным образом определяются характерными для данного географического объекта природными условиями и (или) людскими факторами (далее – российское вино), обладающее особыми свойствами, указанными в Государственном реестре, которое может быть приложено к заявлению о продлении срока действия исключительного права на наименование места происхождения товара.

