Новая обязанность – размещение в реестре:
фотографических изображений общего вида медицинского изделия вместе с принадлежностями, необходимыми для применения изделия 
по назначению; 
фотографических изображений электронного носителя и интерфейса программного обеспечения (для программного обеспечения, являющегося медицинским изделием, в том числе программного обеспечения с применением технологий искусственного интеллекта) (в случае, если имеется);
электронного образа эксплуатационной документации производителя (изготовителя) на медицинское изделие, в том числе инструкции по применению или руководства по эксплуатации медицинского изделия.
